Storyline:

   Sheriff Johnny Reno is heading to a small town in order to see his one-time sweetheart Nona Williams. On the way, he is set upon by two brothers who think he is after them. Forced to shoot one, he captures the other Joe Conners and brings him into town. His prisoner insists he is innocent of the crime the whole town wants him hanged for, and after hearing his story, will Andrews believe him?
